import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

import logo from './img/logo.png';
import rate from './img/rate.png';
import './css/addRating.css';



class addFeedback extends Component{

    constructor(props){
        super(props);

        // this.onChange = this.onChangeType.bind(this);
        // this.onChangeEmail = this.onChangeEmail.bind(this);
        // this.onChangeMessage = this.onChangeMessage.bind(this);

        //this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            one: '',
            two: '',
            three:'',
            four:'',
            five:''
        }
    }

    componentDidMount() {
        //alert('edit id ' +this.props.match.params.id);
        axios.get('http://localhost:4000/feedback/rate/')
            .then(res => {
                this.setState({
                    one: res.data.one,
                    two: res.data.two,
                    three: res.data.three,
                    four: res.data.four
                });
            })
            .catch(function (error){
                console.log("Can't Get Data");
            })
    }
  render() {
    return(
        <div>
            <div className = 'rate-content'>

                <div className='logo'>
                    <a href = "/"><img src = {logo}/></a>
                </div>
                <br/><br/><br/><br/><br/><br/><br/>
                <div className='row'>
                    <div className='col-lg-4'>
                          <img src = {rate} width="300"/>
                    </div>
                    <div className='col-lg-8'>
                        <div className='outer'>
                            <h6>What Do You Think</h6>
                            <h6>About Our Service ?</h6>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
  }
}

export default addFeedback;
